import React from "react";
import {
	chakra,
	Box,
	Flex,
	useColorModeValue,
	SimpleGrid,
	GridItem,
	Heading,
	Text,
	Stack,
	FormLabel,
} from "@chakra-ui/react";
import { Form, Input, Button, Space } from "antd";
import { MinusCircleOutlined, PlusOutlined } from "@ant-design/icons";

export default function ClientDetails() {
	const onFinish = async () => {};
	return (
		<Box bg={useColorModeValue("gray.50", "inherit")} p={10}>
			<Box>
				<SimpleGrid
					display={{ base: "initial", md: "grid" }}
					columns={{ md: 3 }}
					spacing={{ md: 6 }}
				>
					<GridItem colSpan={{ md: 1 }}>
						<Box px={[4, 0]}>
							<Heading
								fontSize="lg"
								fontWeight="md"
								lineHeight="6"
							>
								Profile
							</Heading>
							<Text
								mt={1}
								fontSize="sm"
								color={useColorModeValue(
									"gray.600",
									"gray.400"
								)}
							>
								This information will be displayed publicly so
								be careful what you share.
							</Text>
						</Box>
					</GridItem>
					<GridItem mt={[5, null, 0]} colSpan={{ md: 2 }}>
						<Stack
							px={4}
							py={5}
							bg={useColorModeValue("white", "gray.700")}
							spacing={6}
							p={{ sm: 6 }}
              style={{ minHeight: "80vh" }}
						>
							<Form
								name="dynamic_form_nest_item"
								onFinish={onFinish}
								autoComplete="off"
							>
								<Form.List name="users">
									{(fields, { add, remove }) => (
										<>
											{fields.map(
												({
													key,
													name,
													...restField
												}) => (
													<Space
														key={key}
														style={{
															display: "flex",
															marginBottom: 8,
														}}
														align="baseline"
													>
														<Form.Item
															{...restField}
															name={[
																name,
																"first",
															]}
															rules={[
																{
																	required:
																		true,
																	message:
																		"Missing first name",
																},
															]}
														>
															<Input placeholder="First Name" />
														</Form.Item>
														<Form.Item
															{...restField}
															name={[
																name,
																"last",
															]}
															rules={[
																{
																	required:
																		true,
																	message:
																		"Missing last name",
																},
															]}
														>
															<Input placeholder="Last Name" />
														</Form.Item>
														<MinusCircleOutlined
															onClick={() =>
																remove(name)
															}
														/>
													</Space>
												)
											)}
											<Form.Item>
												<Button
													type="dashed"
													onClick={() => add()}
													block
													icon={<PlusOutlined />}
												>
													Add field
												</Button>
											</Form.Item>
										</>
									)}
								</Form.List>
								<Form.Item>
									<Button type="primary" htmlType="submit">
										Submit
									</Button>
								</Form.Item>
							</Form>
						</Stack>
					</GridItem>
				</SimpleGrid>
			</Box>
		</Box>
	);
}
